import React, { useEffect } from 'react';


function TodoList(props) {
    console.log(props);
    useEffect(()=>{
      let productslist = window.localStorage.getItem('tododata');
    }, [])

  return (
    <div>
        {
            productslist.map((todoitem) => {
                return (
                    <>
                <li>{todoitem.todo}</li>
                <button className='btn btn-primary m-1' onClick={() => props.editProduct(todoitem)}>Edit</button>
                <button className="btn btn-danger m-1" onClick={() => props.deleteProduct(todoitem.id)}>Delete</button>
                </>
            )
            })
        }
    </div>
  )
}

export default TodoList
